class Battery():
    def __init__(self, time_slot, current_soc):
        self.dt = time_slot
        self.current_soc = current_soc
        self.current_power = 0
        self.time_step = 0
        self.model()

    def model(self):
        self.current_soc = self.current_soc - self.current_power
        self.time_step += self.dt

def main():

    soc_list = []
    pb_list = []
    soc_list.append(INITIAL_SOC)
    battery = Battery(CONTROL_TIMESTEP, current_soc= INITIAL_SOC)

    epsilon = []
    p_g = []
    p_b = []
    e_b = []
    i_p_b = []
    i_e_b = []
    l_shed = []
    pv_shed = []
    e_b.append(INITIAL_SOC)
    i_e_b.append(INITIAL_SOC)

    for h in range(0, 24*4, CONTROL_TIMESTEP):
        simu_results = mpc_resilience.mpc_iteration(soc_list[-1], h, prob_outage=outage_prob,
                                                        duration_outage=outage_duration, crit_load=0.5, VoLL=VoLL)

        battery.current_power = simu_results[2]
        battery.model()

        pb_list.append(battery.current_power)
        soc_list.append(battery.current_soc)

        epsilon.append(simu_results[0])
        p_g.append(simu_results[1])
        p_b.append(simu_results[2])
        e_b.append(simu_results[3])
        i_p_b.append(simu_results[4])
        i_e_b.append(simu_results[5])
        l_shed.append(simu_results[6])
        pv_shed.append(simu_results[7])

    e_b.pop(-1)

    print("#Grid-tied simulation with outage probability =", outage_prob, 'VoLL =', VoLL, 'critical load at ',
          critical_load, 'outage duration = ', outage_duration)

    print("soc_list = ", soc_list)
    print("pb_list = ", pb_list)
    #print("epsilon = ", epsilon)
    print("p_g = ", p_g)
    #print("p_b = ", p_b)
    #print("e_b = ", e_b)
    #print("i_p_b = ", i_p_b)
    #print("i_e_b = ", i_e_b)
    #print("l_shed = ", l_shed)
    #print("pv_shed = ", pv_shed)


if __name__ == '__main__':
    main()
